import React from 'react';

const Footer = () => {
    return (
        <footer>
            <div className='container'>
                <div className='row justify-content-center py-3 '>
                    <div className='col  text-center bg-lime'>
                        <img alt='گارانتی' src='./img/guarantee.png' style={{height:"60px",maxWidth:"100%"}}/>
                        <h6 className="mt-2 bg-lime">ضمانت اصل بودن کالا</h6>
                    </div>
                    <div className='col text-center'>
                        <img alt='ضمانت بازگشت' src='./img/return.png' style={{height:"60px",maxWidth:"100%"}}/>
                        <h6 className="mt-2">7 روز ضمانت بازگشت کالا</h6>
                    </div>
                    <div className='col text-center'>
                        <img alt='ارسال سریع' src='./img/delivery.png' style={{height:"60px",maxWidth:"100%"}}/>
                        <h6 className="mt-2">ارسال سریع</h6>
                    </div>
                </div>
                <div className='row'></div>
                <div className='row'></div>
            </div>
        </footer>
    );
};

export default Footer;
